import React from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

const Navbar = () => {
  const { account, logout } = useAuth();

  return (
    <nav className="bg-gray-800 p-4 text-white flex justify-between items-center">
      <div>
        <Link to="/" className="mr-4 hover:underline">Home</Link>
        <Link to="/search" className="mr-4 hover:underline">Search</Link>
        {account && <Link to="/profile" className="hover:underline">Profile</Link>}
      </div>
      <div>
        {account ? (
          <>
            <span className="mr-4">Hi, {account.name || account.username}</span>
            <button onClick={logout} className="bg-red-500 px-3 py-1 rounded">Logout</button>
          </>
        ) : (
          <Link to="/login" className="bg-blue-500 px-3 py-1 rounded">Login</Link>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
